import React, { Component } from 'react';
import { Bar } from 'react-chartjs-2';
import { connect } from 'react-redux';

class Graph extends Component {
  constructor(props) {
    super(props);
    this.state = {
      dataGraph: [
        ['2019年', '1月'],
        ['2019年', '2月'],
        ['2019年', '3月'],
        ['2019年', '4月'],
        ['2019年', '5月'],
        ['2019年', '6月'],
        ['2019年', '7月'],
        ['2019年', '8月'],
        ['2019年', '9月'],
        ['2019年', '10月'],
        ['2019年', '11月'],
        ['2019年', '12月']
      ],
      datasets: [
        {
          data: [5.6, 7.2, 10.6, 13.6, 20, 21.8, 24.1, 28.4, 25.1, 19.4, 13.1, 8.5],
          backgroundColor: 'rgba(30, 144, 255, 1)',
          label: '月別合計降水量(mm)',
        }
      ]
    }
  }

  render(){
    console.log(this.state.dataGraph)
    return(
      <div>
        <Bar data={this.state} />
      </div>
    );
  }
}
Graph = connect((state) => state)(Graph);
export default Graph;
